sourcesContent:
// Import images
import momos from './momos.jpg';
import chickenManchurian from './manchurian.jpg';
import shashlik from './shashlik.jpg';
import kungPaoChicken from './kung pao chicken.jpg';
import whiteSaucePasta from './white sauce pasta.jpg';
import eggFriedRice from './egg fried rice.jpg';
import sweetAndSourChicken from './sweet and sour chicken.jpg';
import chiliChicken from './chili chicken.jpg';
import hotAndSourSoup from './hot and sour soup.jpg';
import DynamiteChicken from './dynamite chicken.jpg';
// Define the Chinese cuisine array
const chineseCuisine = [
    { id: 1, name: "Momos", picture: momos },
    { id: 2, name: "Chicken Manchurian", picture: chickenManchurian },
    { id: 3, name: "Shashlik", picture: shashlik },
    { id: 4, name: "Kung Pao Chicken", picture: kungPaoChicken },
    { id: 5, name: "White Sauce Pasta", picture: whiteSaucePasta },
    { id: 6, name: "Egg Fried Rice", picture: eggFriedRice },
    { id: 7, name: "Sweet and Sour Chicken", picture: sweetAndSourChicken },
    { id: 8, name: "Chili Chicken", picture: chiliChicken },
    { id: 9, name: "Hot and Sour Soup", picture: hotAndSourSoup },
    { id: 10, name: "Dynamite Chicken", picture: DynamiteChicken }
];

// Export the Chinese cuisine array
export default chineseCuisine;
